import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";
import Home from "./home/home";
import CadUser from "./Caduser";

class App extends Component {
  constructor() {
    super();
    this.state = {
      ListaUsuario: [
        {
          nome: "carlinho",
          email: "c@linhos.com"
        }
      ]
    };
  }
  render() {
    return (
      <div>
        <table>
          <thead>
            <tr>
              <th>Nome</th>
              <th>email</th>
            </tr>
          </thead>
          <tbody>
            {this.state.ListaUsuario.map(function(user) {
              <tr>
                <td>{user.nome}</td>
                <td>{user.email}</td>
              </tr>;
            })}
          </tbody>
        </table>

        <div className="App">
          <Home />
        </div>
      </div>
    );
  }
}

export default App;
